INSERT INTO `strategies` (`strategy_id`, `author_id`, `outer_id`, `outer_guid`, `outer_taskid`, `title`, `title_en`, `desc_short`, `desc_full`, `risk_level`, `profit`, `rating`, `currency`, `min_amount`, `min_period`, `max_drawdown`, `hidden`, `created`, `updated`) VALUES
(1, 1, 10017, '318223a1-4671-40ba-bff2-9efabc24048c', 231699, 'Фигурный талант', 'BaseTech', 'Получение доходности с помощью анализа графиков и построения фигур', 'Технический анализ исторических изменений стоимости акций позволяет определять тенденции рынка и прогнозировать изменения. Помимо ценовых рядов учитывается информация об объемах торгов и другие статистические данные.\r\n\r\nЯ использую не только технические индикаторы, но также графические фигуры, свечной график и его паттерны. Успех определяется правильным выбором методов для каждого инструмента. В этой стратегии не задействуем шорт-сделки, считая их особо рисковыми. Диверсификация осуществляется с помощью разделения активов по отраслям.\r\n', 2, 33.20, 5.0, 'RUB', 105000, 0, -6.1, 0, 1577931473, 1633321059),
(2, 1, 10018, '6079f8ad-fd98-4bda-9795-958d3ede2a5c', 231900, 'Фишки в деле', 'EasyPLS', 'Стабильный пассивный доход', 'Инвестиции в компании с высокой капитализацией, с историей стабильного роста и лидерскими позициями, в так называемые голубые фишки. Такие компании выплачивают хорошие дивиденды, отличаются устойчивостью и надежностью. Стратегия подходит начинающим инвесторам, так как обладает минимальными рисками и прогнозируемым результатом. Также предполагает реинвестирование полученного дополнительного дивидендного дохода.', 2, 36.60, 4.9, 'RUB', 10000, 0, -11.6, 0, 1577931473, 1633321059),
(3, 3, 10024, 'fa294565-95f1-4eaa-ac79-73029636432a', 231901, 'Дивидендная подушка', 'GrowingDiv', 'Отличная стратегия, приносящая дивиденды', 'В основе данной стратегии лежит фундаментальный анализ. Он даёт возможность оценить реальную стоимость финансовых инструментов и правильно распределить активы. При этом анализируется не только фундаментальная стоимость компании и ее финансовые коэффициенты, срез отрасли, но экономические и политические факторы.\r\n\r\nНа последнем этапе я анализирую стоимость ценных бумаг. Потенциалом роста здесь обладают те акции, чья расчетная стоимость выше текущей. ', 2, 83.50, 5.0, 'RUB', 250000, 0, -9.8, 0, 1577931473, 1633321059),
(4, 4, 10025, '274a642e-29e9-4abc-a70c-81103869477f', 231856, 'Дивидендный бум', 'DividendBenefit', 'Доходные стратегии с прогнозируемым результатом', 'Стратегия заключается в покупке акций компаний, которые стабильно выплачивают дивиденды своим акционерам. Для создания качественного портфеля необходим  тщательный анализ ключевых параметров деятельности компании, так как высокие выплаты не всегда являются показателем успешности. Я провожу качественный и количественный анализ, слежу за коэффициентами и новостями компании. \r\n\r\nДругим преимуществом дивидендной стратегии является  устойчивость к кризису, поскольку обязательства перед акционерами исполняются, не смотря на сложность текущей экономической ситуации. Распределение активов по отраслям обеспечивает диверсификацию портфеля.', 2, 50.50, 5.0, 'RUB', 100000, 0, -5.6, 0, 1580523473, 1633321059),
(5, 3, 10026, '18a25dbe-408b-4b6a-a3b3-9b0c1dcf4e26', 231857, 'Испытанный веками', 'StabilityUP', 'Оптимальная стратегия высокодоходных инвестиций', 'В основе лежит стратегия «Собаки Доу», которая стремится максимизировать доходность инвестиций, покупая самые высокооплачиваемые дивидендные акции. Портфель составляется из десяти акций и требует ежегодной ребалансировки. Каждый актив подвергается тщательному фундаментальному анализу. Доходность ожидается не только от дивидендов, но также от роста стоимости акций.', 2, 85.20, 5.0, 'RUB', 400000, 0, -14.2, 0, 1580523473, 1633321059),
(6, 2, 10029, 'b44ba1aa-06ab-42ba-bd8e-4aef88f4c0c2', 231902, 'Вперед в Америку', 'CatchUp', 'Инвестиции в акции США', 'Уникальные отрасли экономики, компании роста, большие транснациональные компании, долларовые инвестиции на фоне девальвации рубля и инфляции делают американский рынок очень привлекательным для инвестиций.\r\n\r\nЯ распределяю активы между надежными и дивидендными акциями различных секторов, покупаю на просадках, основываясь на финансовых показателях, ситуацией на рынке и анализом тренда.', 3, 174.00, 4.8, 'USD', 1000, 0, -17.4, 0, 1580523473, 1633321059),
(7, 2, 10031, '8e15c699-2f21-4300-bd6d-9c4e07994651', 231903, 'Опережая индекс', 'ForceIndex', 'Оптимальная стратегия повторения результатов популярного индекса', 'При индексном инвестировании результаты инвестиционного портфеля привязываются к динамике одного из фондовых индексов. Для создания такого портфеля подбираются инструменты, составляющие расчётную базу интересующего индекса. Такой вариант инвестирования не требует частого пересмотра состава, а в долгосрочной перспективе приносит хороший пассивный доход. Портфель диверсифицируем за счёт разделения активом по отраслям.', 6, 34.80, 4.9, 'RUB', 160000, 0, -3.4, 0, 1581408480, 1633321059),
(8, 1, 10032, 'f7b678eb-108d-4613-bd30-168f7b752f1f', 231920, 'Акции 3х', 'Light Start', 'Инвестиции как альтернатива банковскому депозиту', 'Целью стратегии является обеспечение годового дохода, превосходящего процент по банковскому депозиту. Подходит для начального инвестирования. Низкий порог входа. Портфель диверсифицируется по отраслям.\r\n\r\nЯ изучаю каждую компанию, графики и финансовую отчетность, сравниваю с конкурентами, добавляю в портфель только после всестороннего анализа.', 3, 17.30, 4.8, 'RUB', 2000, 0, -5.9, 0, 1581491280, 1633321059),
(9, 4, 10033, '18dccac6-3a93-4c00-a33d-89199de0ad31', 231921, 'Проще простого', 'Top10', 'Создание портфеля, который не даст инфляции победить', 'Данная стратегия основана на выборе акций первого и второго эшелона с разделением по отраслям для снижения риска. Компании отбираются на основании проведенного фундаментального анализа, новостного фона и оценки ситуации на рынке в целом. В портфель преимущественно попадают высоколиквидные акции. Четкое следование стратегии снижает риски и позволяет успешно управлять портфелем.', 3, 27.70, 4.8, 'RUB', 15000, 0, -7.7, 0, 1581750480, 1633321059);
INSERT INTO `strategy_authors` (`author_id`, `first_name`, `last_name`, `description`, `photo`) VALUES
(1, 'Екатерина', 'Черноглазова', 'Екатерина с отличием окончила Московский Государственный Университет Экономики Статистики и Информатики (2005-2010)\r\n\r\nСпециализация: финансы и кредит / направление инвестиционное дело\r\n\r\nС 2011 г активно практикует инвестиции в ценные бумаги. Открывает сделки на основе объективных биржевых данных. Предпочитает долгосрочные виды инвестирования. Допускаются просадки до -30%. Сделки открывает ритмично и регулярно. В постоянном режиме открывает для себя новые стратегии.\r\n\r\n2011-2013 Риск-менеджер отдел проектной экспертизы\r\n2012- по н.в.  торговля на бирже\r\n2013-2015 Бизнес-планирование и запуск компании\r\n2013 Курсы финансовых рынков\r\n2014-2020  Фриланс по анализу ценных бумаг, бизнес планирование, анализ портфелей\r\n2018  Курсы Financial Markets and Investment Strategy\r\n\r\nСамообучение : Портфельные инвестиции, технический анализ , венчурное финансирование инновационных проектов. \r\nУчаствует в вебинарах популярных площадок по инвестициям.', '/storage/chernoglazova.jpg'),
(2, 'Игорь', 'Скарга', 'Закончил Владимирский филиал Финансового университета при Правительстве Российской Федерации \r\nФакультет: Экономика и финансы\r\n\r\nАктивный участник торгов с 2012 года. Финансовые инструменты предпочитает акции и облигации, а так же срочный рынок, рынок криптовалют. Использует рисковые стратегии, но в зависимости от ситуации на рынке стратегия может быть изменена на более консервативную. В анализе рынка использует в первую очередь технический анализ. Считает главными факторами успешного трейдера : самодисциплину, контроль рисков, отсутствие эмоций и терпение.', '/storage/skarga.jpg'),
(3, 'Ксения', 'Курбанова', 'C отличием окончила магистратуру Московского государственного университета экономики, статистики и информатики по направлению «экономическая теория и инвестиции».\r\n\r\nC 2015 года на позициях финансового аналитика и риск-менеджера в крупнейших Family-офисах.\r\n\r\nУспешный трейдер, имеет большой практический опыт фундаментального анализа, что позволяет избегать сильных просадок в сравнении с ключевыми мировыми индексами.\r\n\r\nВ работе с биржевыми инструментами предпочитает среднесрочные инвестиционные стратегии. В приоритете - работа с акциями технологичного сектора экономики. Проводит исследования в области управления рисками и капиталом, а также занимается тестированием и оптимизацией торговых стратегий.', '/storage/kurbanova.jpg'),
(4, 'Андрей', 'Бородай', 'Закончил Российский Государственный Гуманитарный Университет факультет экономика\r\n \r\nОнлайн курсы повышения квалификации: «Деньги, банки, финансовые рынки», «Финансы и инвестиции», «Рынок ценных бумаг и инвестиционное дело».\r\n\r\nЗанимается инвестициями с 2010 года. Начинал с небольшого капитала и успешно его приумножил. Разработал свою стратегию и четко ей следует. Изучает финансовые рынки по средствам изучения рынков, обучается на курсах, участвует в вебинарах известных аналитиков. Считает, что терпение лучший помощник для выбора удачного входа в позицию.\r\n\r\nПридерживается консервативных взглядов в отношении составления портфеля. Допускает просадки до 10%.', '/storage/boroday.jpg');
